キャンピングカー用ドアパーツ<br>
セキュリティ46(ロック機能付き)直径30mmのアルミでできた強固なハンドルです。
左右どちらにも90度倒すことができ、ドア側に倒すことでドアをロックすることができます。
<br><br>

<font color="#ff0000">【ご注意】</font>

取り付けについては、資格等は必要ありませんが専門店にご依頼するのがベストです。
<br><br>
良品の返品はできませんことご了承ください。<br><br>
